import React from "react";
import { Paper,TableContainer,Table,TableHead,TableRow,TableCell,TableBody, TablePagination } from "@material-ui/core";

import useStyle from "./styles";

interface Column {
    id: 'id' | 'date' | 'severity' | 'desc' ;
    label: string;
    minWidth?: number;
    align?: 'right';
    format?: (value: number) => string;
  }

  const columns: Column[] = [
    { id: 'id', label: 'CEV ID', minWidth: 170 },
    { id: 'date', label: 'PUBLISED DATE', minWidth: 100 },
    {
      id: 'severity',
      label: 'SEVERITY',
      minWidth: 170,
      align: 'right',
      format: (value: number) => value.toLocaleString('en-US'),
    },
    {
      id: 'desc',
      label: 'DESCRPTION',
      minWidth: 170,
      align: 'left',
      format: (value: number) => value.toFixed(2),
    },
  ];

const Dashboard = () => {
  const classes = useStyle();

  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow> {columns.map((column) =>(
            <TableCell key={column.id} align={column.align} style={{ minWidth: column.minWidth }}>
            {column.label}
            </TableCell>))}

            </TableRow>
          </TableHead>
          <TableBody>hola</TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default Dashboard;
